import axios from 'axios'
import React, { useState } from 'react'
import { useNavigate } from 'react-router-dom'
import Animation from './Animation'
import { SectionsContainer, Section } from 'react-fullpage'
import TagsInput from './TagsInput'
import Madcomponent from './Mapcomponent'
import serialize from 'serialize-javascript'
const Login = () => {
  let options = {
    anchors: ['sectionOne', 'sectionTwo', 'sectionThree'],
  }
  const navigate = useNavigate()
  const [nickname, setNickName] = useState('')
  const [map, setMap] = useState([])
  const [tag, setTag] = useState([])
  const Rest_api_key = 'dcb8c3b23d720c296085cbdc9046ece9'
  const redirect_uri = 'http://localhost:3000/oauth'
  const API_URL = 'http://172.10.5.102:80'
  const kakaoURL = `http://kauth.kakao.com/oauth/authorize?client_id=${Rest_api_key}&redirect_uri=${redirect_uri}&response_type=code`
  function serialize(obj) {
    const simpleObject = {
      nickname: obj.nickname,
      map: obj.map,
      tag: obj.tag,
    }
    return JSON.stringify(simpleObject)
  }

  useEffect(() => {
    ImageMap('img[usemap]')
  }, [])

  const clickHandler1 = () => {
    alert('중구')
    setMap([...map, 'Junggu'])
  }
  const clickHandler2 = () => {
    alert('동구')
    setMap([...map, 'Donggu'])
  }

  const clickHandler3 = () => {
    alert('서구')
    setMap([...map, 'Seogu'])
  }

  const clickHandler4 = () => {
    alert('대덕구')
    setMap([...map, 'Daedeokgu'])
  }
  const clickHandler5 = () => {
    alert('유성구')
    setMap([...map, 'Yuseonggu'])
  }

  const postInfo = async () => {
    try {
      console.log('nickname:', nickname)
      console.log('map:', map)
      console.log('tag:', tag)

      await axios({
        method: 'post',
        url: `${API_URL}/signup`,
        data: JSON.parse(
          serialize({
            nickname,
            map,
            tag,
          })
        ),
        headers: {
          'Content-Type': 'application/json',
          Authorization: localStorage.getItem('user_token'),
        },
      })
      console.log('서버로 데이터 보내기 성공')
    } catch (e) {
      console.log('무슨오류냐면', e)
    }
  }
  return (
    <SectionsContainer {...options}>
      <Section>
        <div className="login">
          <div className="loginBox">
            <div className="logBoxLeft">
              <Animation />
            </div>
            <div className="logBoxRight">
              <p className="loginTitle">Welcome!</p>
              <input
                type="text"
                className="input"
                onChange={e => {
                  setNickName(e.target.value)
                }}
              />
            </div>
          </div>
        </div>
      </Section>

      <Section>
        <div className="login">
          <div className="loginBox">
            <div className="logBoxLeft">
              <Animation />
            </div>
            <div className="logBoxRight">
              <p className="loginTitle">Welcome!</p>
              <TagsInput setTag={setTag} />
            </div>
          </div>
        </div>
      </Section>

      <Section>
        <div className="login">
          <div className="loginBox">
            <div className="logBoxLeft">
              <Animation />
            </div>
            <div className="logBoxRight">
              <p className="loginTitle">Welcome!</p>
              <Madcomponent setMap={setMap} />
              <button onClick={postInfo}>Complete</button>
            </div>
          </div>
        </div>
      </Section>
    </SectionsContainer>
  )
}
export default Login
